import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class account extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment>
            <div></div>
        </Fragment>)
    }

}

export default withRouter(account);
